import React, { forwardRef } from "react";
import { Technique } from "./Technique.js";

// export const NakedSingle = (props) => {
//   return <h2>naked single</h2>;
// };

const check = (cell) => {
  if (cell.suspects.size === 1) {
    return cell.suspects.values().next().value;
  }
  return 0;
};

export const NakedSingle = {
  check: check,
  name: "Naked Single",
};
